  \"Observations of the vegetation of the Atigun River floodplain as affected by the
  crude oil spill from the Trans-Alaska Pipeline\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:28.466257\",\n\t\"name\": \"observations-of-the-vegetation-of-the-atigun-river-floodplain-as-affected-by-the-crude-oil\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report is a summary of the results
  of botanical investigation conducted along the Atigun River, associated side channels
  and tributaries during the period 26 u2013 28 June 1979. The work follows the release
  of crude oil from a break in the Trans-Alaska Pipeline near Atigun Pass. When discovered,
  oil had entered the aquatic environment during a high water stage. Containment dikes
  which restrained oil at the headwaters of the Atigun River ruptured on 25 June 1979
  releasing additional quantities of oil; also during high water. Because oil was
  released during this period, much of the riparian vegetation of the Atigun River
  floodplain was oiled. This investigation was designed to ascertain which species
  of plants were affected by the oil. Additional efforts centered on the chronic effects
  the contaminant may have on existing plant communities.\",\n\t\"license_title\":
